import React from "react";
import { Link } from "react-router-dom";
import Section from "../components/UI/Section";
import SectionDivider from "../components/UI/SectionDivider";
import { motion } from "framer-motion";
import DueDateCountdown from "../components/DueDateCountdown";

const Home = () => {
  return (
    <div className="min-h-screen bg-white">
      {/* Hero Section */}
<Section center tightTop compact>
  <motion.div
    initial={{ opacity: 0, y: 20 }}
    animate={{ opacity: 1, y: 0 }}
    transition={{ duration: 0.8, ease: "easeOut" }}
    className="relative overflow-hidden rounded-[2.5rem] bg-babyPink/30 px-6 py-16 text-center shadow-md"
  >
    <motion.h1
      initial={{ opacity: 0, y: 24, scale: 0.98 }}
      animate={{ opacity: 1, y: 0, scale: [0.98, 1.03, 1] }}
      transition={{ duration: 0.55, ease: "easeOut" }}
      className="mb-4 text-center font-serif leading-tight text-babyBlue text-4xl sm:text-5xl tracking-tight"
    >
      <motion.span
        initial={{ opacity: 0, y: 12 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5, ease: "easeOut", delay: 0.1 }}
        className="font-cursive text-6xl sm:text-[4rem] inline-block mr-2 text-babyBlue"
      >
        Taylor-Made
      </motion.span>
      <motion.span className="text-babyBlue">Baby Planning</motion.span>
    </motion.h1>

    <p className="text-lg md:text-xl text-black/70 max-w-2xl mx-auto">
      A calm, confident path to welcoming your little one. Personalized
      registries, nursery design, shower planning, and ongoing
      supportâ€”tailored to your family.
    </p>

    <motion.img
      src="/assets/hero-baby.png"
      alt="Baby Planning Illustration"
      className="mx-auto mt-6 max-w-md drop-shadow-lg animate-float"
      initial={{ opacity: 0, scale: 0.95 }}
      animate={{ opacity: 1, scale: 1 }}
      transition={{ duration: 0.8, ease: "easeOut", delay: 0.3 }}
    />
  </motion.div>
</Section>

      {/* Countdown Section */}
      <Section title="Countdown to Baby Day ðŸŽ‰" center className="bg-babyBlue/10 rounded-3xl">
        <DueDateCountdown dueDate="2025-12-01" />
      </Section>

      <SectionDivider className="my-6" />

      {/* Services Section */}
      <Section title="Services Snapshot â€” Taylor-Made for You" tightTop compact className="bg-babyPink/10 rounded-3xl">
        <div className="px-6 py-6">
          <div className="grid gap-6 md:grid-cols-2 lg:grid-cols-3">
            {[
              { title: "Registry Concierge", desc: "Curated lists, managed & delivered.", icon: "ðŸ—’ï¸" },
              { title: "Personal Shopping", desc: "VIP access & white-glove delivery.", icon: "ðŸ›ï¸" },
              { title: "Nursery Design", desc: "Safety + styling planned seamlessly.", icon: "ðŸ›ï¸" },
              { title: "Events & Celebrations", desc: "Baby showers, sip-and-sees.", icon: "ðŸ¥‚" },
              { title: "Family Integration", desc: "Support for siblings & pets.", icon: "ðŸ‘¨â€ðŸ‘©â€ðŸ‘§â€ðŸ‘¦" },
              { title: "Ongoing Concierge", desc: "Postpartum coaching & more.", icon: "â³" },
            ].map((service, index) => (
              <motion.div
                whileHover={{ scale: 1.05, y: -2 }}
                initial={{ opacity: 0, y: 15 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.3, delay: index * 0.1 }}
                key={service.title}
                className="rounded-2xl border border-babyBlue/30 bg-white/90 px-5 py-6 shadow-sm hover:bg-pastelGreen/20 transition"
              >
                <div className="text-3xl">{service.icon}</div>
                <h3 className="mt-3 font-serif text-xl text-black">{service.title}</h3>
                <p className="mt-2 text-sm text-black/70 leading-relaxed">{service.desc}</p>
              </motion.div>
            ))}
          </div>
        </div>
      </Section>

      {/* Keep Testimonials, Process, Membership, About sections with pastel backgrounds */}
      <SectionDivider className="my-6" />
    </div>
  );
};

export default Home;
